import NavBar from "./NavBar";
import Form from "./Components/Form";
import './App.css';
import { useState } from "react";

function App() {
  return (
    <div className="background">
      <NavBar></NavBar>
      <div style={{ position: "absolute", top: "50%", left: "50%", transform: "translate(-50%, -50%)"}}>
        <Form></Form>
      </div>
    </div>
  );
}

export default App;
